import React from "react";
import avatar from "../assets/ayoub.jpeg";
import "../assets/NavBar.css";
function NavBar() {
	const onclick = (id) => {
		document.getElementById(`${id}`).css.backgroundColor = "blue";
	};
	const links = ["Todo", "Chat", "About", "ContactUs"];
	return (
		<nav className="nav">
			<h3 className="nav__title">
				ToDo <span>List</span>
			</h3>

			<ul className="nav__list">
				<li>
					<a>{element}</a>
				</li>
				<li id="todo">
					<a onClick={onclick.bind(this)} href="/">
						ToDo
					</a>
				</li>
				<li id="chat">
					<a href="/">Chat</a>
				</li>
				<li id="about">
					<a href="/">About</a>
				</li>
				<li id="contactus">
					<a href="/">ContactUs</a>
				</li>
			</ul>
			<img src={avatar} width="40px" />
		</nav>
	);
}

export default NavBar;
